import { BrowserRouter, Route, Switch } from "react-router-dom";
import { Suspense } from 'react'
import { routes } from "../router";


function App() {
  return (
    <div>
   
      <BrowserRouter>
      <Suspense  fallback={<h1>Loading...</h1>}>
      <Switch>
        {routes.map((route) => (
          <Route key={route.path} {...route} />
        ))}
      </Switch>
      </Suspense>
      </BrowserRouter>
    </div>
  );
}

export default App;
